function cargargrid_jugadores(){
    $("#crear_qr").hide();
    $("#DescargarGafet").hide();
    $("#DescargarArchivoPDF").hide();
    $('#mostrar_jugadores').hide();
    $("#cargando_tabla").show();
    $.ajax({
        url: "../utileria.php",
        type: "post",
        data: {"param":6},
        success: function(result) {
            let data = JSON.parse(result);
            if (data.estatus == 'success') {
                datos = data.data;
                $("#cargando_tabla").hide();
                $('#mostrar_jugadores').show();
                listar_jugadores(datos);
                $("#crear_qr").show();
                $("#DescargarArchivoPDF").show();
                $("#DescargarGafet").show();
            }else{
                Swal.fire('Sin registros', data.mensaje, "info");
            }
        }
    });
}
  
