let obtener_data_jugadores_editar = function(tbody, table_jugadores){
    $(tbody).on("click", "button#editar_jugador_modal", function(){
        $("#input_file_oculto").hide();
        $("#ocultar_camara").hide();
        $("#foto_tomada").hide();
        bandera_camara = 1;
        EncenderCamara();
        let datos = table_jugadores.row($(this).parents("tr") ).data();
        if (datos.NoFMT == '02NL073101706') {
            $("#input_file_oculto").show();
        }
        $("#foto_editar").html("");
        $("#editar_numero_leon").val(datos.NoNL);
        $("#editar_numero_fmt").val(datos.NoFMT);
        $("#editar_categoria").val(datos.Categoria);
        $("#editar_nombre_jugador").val(datos.Nombre);
        $("#editar_apellidoP").val(datos.ApPaterno);
        $("#editar_apellidoM").val(datos.ApMaterno);
        $("#editar_club").val(datos.Club);
        $("#editar_rama").val(datos.Rama);
        $("#editar_qrcode").html("");
        if (datos.Img != '') {
            $("#foto_tomada").show();
            $("#foto_editar").append(`<img src="${datos.Img}" alt="">`);
        }else{
            $("#ocultar_camara").show();
        }
        editar_qrcode();
    });
}

