function add_qrcode() {
    let update_numero_nl = $("#add_numero_leon").val(),
    update_numero_fmt = $("#add_numero_fmt").val(),
    update_categoria = $("#add_categoria").val(),
    update_nombre_jugador = $("#add_nombre_jugador").val(),
    update_apellido_p = $("#add_apellidoP").val(),
    update_apellido_m = $("#add_apellidoM").val();
    let update_nombre_completo = update_nombre_jugador+" "+update_apellido_p+" "+update_apellido_m;
    if (update_nombre_jugador != '' && update_apellido_p != '' && update_apellido_m != '' 
    && update_numero_nl != '' && update_numero_fmt != '' && update_categoria != '') {
        $("#add_qrcode").html("");
        let qrcode = new QRCode(document.getElementById("add_qrcode"), {
            text: update_numero_nl+","+update_nombre_completo+","+update_numero_fmt+","+
            update_categoria,
            width: 128,
            height: 128,
            colorDark : "#000000",
            colorLight : "#ffffff",
            correctLevel : QRCode.CorrectLevel.H,
        });   
    }
}

