$("#crear_qr").on("click", function(){
    $("#lbl_crear_qr").hide();
    $('#cargando_qr').show();
    $.ajax({
        url: "../utileria.php",
        type: "post",
        data: {"param":17},
        success: function(result) {
            let data = JSON.parse(result);
            if (data.estatus == 'success') {
                let datos_qr = data.data;
                for (let i = 0; i < datos_qr.length; i++) {
                    let numero_nl = datos_qr[i].NoNL != '' && datos_qr[i].NoNL != null ? datos_qr[i].NoNL : 0,
                    numero_fmt = datos_qr[i].NoFMT != '' && datos_qr[i].NoFMT != null ? datos_qr[i].NoFMT : 'No disponible',
                    categoria = datos_qr[i].Nombre_Categoria != '' ? datos_qr[i].Nombre_Categoria : 'No disponible',
                    nombre_completo = datos_qr[i].Nombre_Completo != '' ? datos_qr[i].Nombre_Completo : 'No disponible';

                    let qrcode = new QRCode(document.getElementById("qrcode_all"), {
                    text: numero_nl+","+nombre_completo+","+numero_fmt+","+categoria,
                    width: 128,
                    height: 128,
                    colorDark : "#000000",
                    colorLight : "#ffffff",
                    correctLevel : QRCode.CorrectLevel.H,
                    });
                    let image_url =  document.getElementById("qrcode_all").children[0].toDataURL("image/png");
                    datos_qr[i].ImgQR = image_url;   
                    $("#qrcode_all").html("");
                }
                
                $.ajax({
                    url: "../utileria.php",
                    type: "post",
                    data: {"param":19, "datos":datos_qr},
                    success: function(result) {
                        let data = JSON.parse(result);
                        if (data.estatus == 'success') {
                            $('#cargando_qr').hide();
                            $("#lbl_crear_qr").show();
                            cargargrid_jugadores();
                        }else{
                            $('#cargando_qr').hide();
                            $("#lbl_crear_qr").show();
                        }
                    }
                });
            }else{
                $('#cargando_qr').hide();
                $("#lbl_crear_qr").show();
                Swal.fire('Sin QRs', data.mensaje, "info");
            }
        }
    });
});

/* camara */
function EncenderCamara(){
	if (screen.width > 1024){ 
		Webcam.set({
			// live preview size
			width: 220,
			height: 250,
			
			// device capture size
			dest_width: 220,
			dest_height: 250,
			
			// final cropped size
			crop_width: 200,
			crop_height: 250,
			
			// format and quality
			image_format: 'jpeg',
			jpeg_quality: 90
			
		});
        if (bandera_camara == 0) {
            Webcam.attach( '#my_camera' );   
        }else{
            Webcam.attach( '#editar_my_camera' );
        }
	}else{
		Webcam.set({
			// live preview size
			width: 220,
			height: 250,
			
			// device capture size
			dest_width: 220,
			dest_height: 250,
			
			// final cropped size
			crop_width: 200,
			crop_height: 250,
			
			// format and quality
			image_format: 'jpeg',
			jpeg_quality: 90
			,
			constraints: {
				facingMode: {
					exact: 'environment'
				}
			} 
		});
		if (bandera_camara == 0) {
            Webcam.attach( '#my_camera' );   
        }else{
            Webcam.attach( '#editar_my_camera' );
        }
	}
}

function DetenerCamara(){
	Webcam.reset();
}
//Camara
function take_snapshot() {
	var Captura = $("#img").val();
	if(Captura == ''){
		Webcam.snap( function(data_uri) {	
            if (bandera_camara == 0) {
                document.getElementById('results'+1).innerHTML = 
                '<img src="'+data_uri+'" style="width: 200px; height: 180px;"/> <br><br><button class="btn btn-success" onclick="BorrarFoto('+1+')">Borrar</button>';
                $("#img").val(data_uri);
            }else{
                document.getElementById('results_editar'+2).innerHTML = 
                '<img src="'+data_uri+'" style="width: 200px; height: 180px;"/> <br><br><button class="btn btn-success" onclick="BorrarFoto('+2+')">Borrar</button>';
                $("#img_editar").val(data_uri);
            }		
		});
	}
	
}

function BorrarFoto(NumerodeFoto){
    if (bandera_camara == 0) {
        document.getElementById('results'+NumerodeFoto).innerHTML = '';
        $("#img").val('');
    }else{
        document.getElementById('results_editar'+NumerodeFoto).innerHTML = '';
        $("#img_editar").val('');
    }

    if(NumerodeFoto >2){
        $(".InformacionFoto"+NumerodeFoto).hide();
    }
}

